cw-Photon.init:
function ($o) {
	var that = this,
			d = that.data,
			cfg = that.Cfg,
			childs = 'Tab Login Logout Compact NewDB DelDB SecObj NewSync'.split(' ').add(Object.keys(that).filter(/^\$/));

	// isStandalone
	that._compiled = that._compiled || !cw.CW;

	// init Photon local storage
	that.Ls = that.Ls();

	// Base
	if (!that.Base) {
		that.Base = window.DDOC ? window.DDOC._base : [location.protocol,'',location.host,''].compact().join('/');
	}

	// HTML
	$o.formgen('init', that.HTML.assign(that.lang));

	// Mount editors, taken from global cache
	Object.keys(that.Ed).forEach(function(k){
		if (!that.Ed[k].id) return;
		that.Ed[k] = $.extend(
			true, 
			$.my.cache(that.Ed[k].id) || {}, 
			that.Ed[k], 
			{Pho:that.Pho}
		);
	})

	// Mount lang and Pho on child manifests
	childs.forEach(function(m){
		if (!that[m]) return;

		if (that[m].lang) $.extend(that[m].lang, that.lang[m] || {});
		that[m].Pho = that.Pho;
		that[m].Req = that.Req;
	});

	// j2h converter
	that.j2h = that.Ed.jsontree.j2h;

	// Mount app/tab close event handler
	$o.on('tabclose.my', function(evt, tabid){ that.Close(tabid); });

	// on Standalone run
	if (that._compiled) {
		// Tab restore
		var tabs = that.Ls('TabCloseHistory');
		if (tabs && tabs.length) {
			if (Date.now() - tabs[0].stamp < 30e3) that.Tabs = Object.clone(tabs[0].tabs, true);
			else {
				//search for most fat
				var fat = [];
				tabs.forEach(function(e){
					if (Date.now() - e.stamp > 180*24*36e5) return;
					if (fat.length < e.tabs.length) fat = e.tabs;
				});
				if (fat.length) that.Tabs = Object.clone(tabs[0].tabs, true);
			}
		}
	}

	// After app init
	$o.then(function(){

		// Specific parts
		// for in-CloudWall exec...
		if (!that._compiled) {
			cw.log('Photon started in CloudWall');
			$o.on('click.my','a',function(evt){
				var $a = $(evt.currentTarget),
						href = $a.attr('href');
				if (href[0]=='#') {
					var path = decodeURIComponent(href.replace(/^#+\/?/,'')).split('/').compact(true);
					that.Switch(path);
					return false;
				}
			});
		}

		// ... or Standalone run
		if (that._compiled) {
			cw.log('Photon couchapp started');
			// start router
			(function _Router (start) {
				function _route(){
					var h = (location.hash+'').replace(/^#+/,'').split('/').map(decodeURIComponent);
					if (h[1]=='_design') { h[2] = '_design/'+h[2]; h.removeAt(1); }
					that.Switch(h);
				}
				var prevhash = start || '';
				$(window).on('hashchange', _route.debounce(1000/60 + 3));
				if (start != null) location.hash = start+'';
				$(window).trigger('hashchange');
			})();

			// Icon image
			$('link[rel="icon"]').attr("href", that.files['favicon.png'].url);

			// beforeunload handler, checks if all tab changes are saved
			window.onbeforeunload = function(e) {
				var dlg;
				if (that.Tabs.find(function(e){return e.hash0!=e.hash1})) {
					var dlg = that.lang.DLG_UNLOAD;
					e.returnValue = dlg;
				}
				return dlg;
			};

			// stash tabs on unload
			$(window).on('unload', function(){
				var tabs = Object.clone(that.Tabs, true),
						history = that.Ls('TabCloseHistory') || [];
				history.unshift({stamp:Date.now(), tabs:tabs.map(function(e){
					e.run = false; 
					e.error = false; 
					e.hash0=e.hash1='';
					return e;
				})});
				that.Ls('TabCloseHistory',history.to(3));
			});

		}

		// rebuild styles
		that.my.restyle();

	}.debounce(10));

	return that.GetList();

}

