cw-Photon.Req:
function _Req(opts0) {

	var isS = Object.isString,
			isO = Object.isObject,
			isA = Object.isArray;

	var that = this,
			d = that.data,
			cfg = that.Cfg,
			l = that.lang,
			pi = $.Deferred();

	var opts = $.extend(
		true, 
		{
			method:'GET',
			dataType:'json',
			headers:{ Accept:'application/json' },
			cache:false
		},
		isO(opts0)?opts0:isA(opts0)?{url:opts0}:{url:opts0+''}
	);

	var url = a2url(opts.url, that.Base);

	if (!url) E(400, l.ERR_REQ_INVALIDCALL);

	opts.url = url;

	$.ajax(opts)
	.then(function(res){
		pi.resolve(res);
	})
	.fail(function(res, b){
		var code = res.status,
				data = res.responseJSON || {ok:false},
				msg = data.message || '';
		E(code, msg, data);
	});

	return pi.promise();

	// - - - - - - -

	function E(code0, msg0, data) {
		var code = !isNaN(code0)?(+code0):500,
				msg = (isNaN(code0) && !msg0)?code0:msg0;
		if (!msg) {
			msg = l.ERR_REQ[code] || l.ERR_REQ[999];
		}
		msg+='';
		pi.reject(code, msg, data);
	}

	// - - - - - - - 

	function a2url(a, base0) {
		var p = [],
				q = {},
				qa = [],
				url = '',
				base = base0?(base0+'').replace(/\/+$/,'')+'/':'',
				tostr = {startkey:1,endkey:1,start_key:1,end_key:1,key:1},
				reddoc = /^_design\//;

		if (typeof a == 'string') {
			url = !/^http[s]?:/.test(a)?base+a.replace(/^\/+/,''):a;
		}
		else if (Object.isArray(a)) {
			a.forEach(function(e, i){
				if(''===e || null==e) return;
				if (Object.isObject(e)) $.extend(true, q, e);
				else if (reddoc.test(e+'')) p.add((e+'').split('/'));
				else p.push(encodeURIComponent(e+''));
			});

			qa = Object.keys(q).map(function(key){
				var v = q[key];
				if (tostr[key] || typeof v != 'string') v = JSON.stringify(v);
				return encodeURIComponent(key)+'='+encodeURIComponent(v);
			});

			url = base+p.join('/')+(qa.length?'?'+qa.join('&'):'');
		}

		return url;
	}
}

