cw-Photon.Switch:
function _switch(path0,tabid) {

	// Switches tabs, called by flatiron on hash change
	// or internal router if env is CloudWall big

	cw.log('Photon tab switch attempt', path0, tabid||'')

	var that = this,
			_redrawTabs = _redrawTabsSync,//.debounce(0),
			d = that.data,
			path = (
				Object.isString(path0)
				? path0.replace(/^#/,'').split('/').compact(!0)
				: Object.isArray(path0)
				? path0.slice(0).compact(true)
				: []
			);

	if (path[1]=='_design') {path[2] = '_design/'+path[2]; path.removeAt(1);}

	var spath = path.join('\fffd'),
			switcher = [],
			newtab,
			isNew = false;

	that.Tabs.forEach(function(t){
		if (t.path.join('\fffd') == spath) switcher.push(t);
	});
	if (switcher.length > 1) {
		if (tabid) {
			switcher[0] = switcher.find(function(tf){return tf.id == tabid}) || switcher[0];
		}
	}
	newtab = switcher[0];

	if(newtab && newtab.active && newtab.run) return false;

	// Derive type
	var type = 'error',
			title = 'Error',
			isDB = /^(_users|_replicator|[a-zA-Z0-9$\(\)\+\-][a-zA-Z0-9$\(\)\+\-\/_]*)$/.test(path[0]),
			appData,
			pl = path.length;
	if (!pl) {
		title = 'Photon';
		type = 'dbs';
	}
	else if (pl == 1 && path[0]=='_config') {
		title= '_config';
		type='config';
	}
	else if (pl == 1 && path[0]=='_about') {
		title= 'About';
		type='about';
	}
	else if (isDB && path[1]=='_new') {
		title = 'New doc';
		type = 'doc';
		appData = {isNew:true}
	}
	else if (isDB && (pl == 1 || path[1] == '_view'|| path[1] == '_all_docs')) {
		title = path[0];
		type = 'view';
		if (path[1] == '_all_docs') {
			if (pl!=4) path.length = 1;
			else {
				appData = {
					start:path[2], 
					limit:'+'+(that.$view.Steps.find(Math.abs(+path[5])) || '100'),
					reverse:(path[3]+'')[0]=='-'
				}
			}
		}
		else if (path[1] == '_view') {
			if (pl!=6) path.length = 4;
			else {
				appData = {
					start:path[4], 
					limit:'+'+(that.$view.Steps.find(Math.abs(+path[5])) || '100'),
					reverse:(path[5]+'')[0]=='-'
				}
			}
		}
	}
	else if (pl == 2 && isDB) {
		title = path[0].truncate(10,'right','…')+'\u2009/\u2009'+path[1];
		type = 'doc';
	} 
	else if (pl == 3 && path[1] == '_design') {
		title = path[0].truncate(10,'right','…')+'\u2009/\u2009'+'_d…'+path[2];
		type = 'doc';
	}
	else if (pl == 3 && isDB) {
		title = path[0].truncate(10,'right','…')+'\u2009/\u2009'+path[1];
		type = 'doc';
		appData={rev:path[2].replace(/^\D+/,'')}
	}

	if (type=='error') appData = {error:'Unrecognized command'}


	// Switch off tabs
	that.Tabs.forEach(function(t){
		if (t!==newtab) t.active = false;
	});

	// new tab not exists?
	if (!newtab) {

		if (that.Tabs.length >= that.Cfg.maxTabs) {
			cw.lib.note(that.lang.FAIL_TOO_MANY_TABS.assign(that.Cfg.maxTabs+''), 'error');
			return false;
		}

		isNew = true;
		newtab = {
			id:cw.lib.sdbm(Date.now()+path),
			type:type,
			hash0:'',hash1:'',
			active:true,
			name:title,
			path:path.slice(0),
			error:type=='error',
			run:false
		};
		if (type!='dbs') that.Tabs.push(newtab);
		else that.Tabs.unshift(newtab);
	}

	newtab.active = true;
	that.SetTitle(newtab.name);
	that.my.restyle();
	_redrawTabs();

	var app = _runApp(type, path, newtab.id, appData);

	if (app.then) {
		app.then(function(){
			var waschanged = false;
			newtab.run = true;
			// we were able to start it
			cw.log('Photon tab of type ${1} started'.assign(type), path);
			newtab.hash0 = newtab.hash1 = app.my('manifest').hash();
			newtab.name = app.my('manifest').title();
			that.SetTitle(newtab.name);
			if (that.History.last() != newtab.id) that.History.push(newtab.id);

			// Track app changes
			app.on('change.my', function(){
				newtab.hash1 = app.my('manifest').hash();
				var name = app.my('manifest').title();
				if (newtab.hash0 != newtab.hash1 || name != newtab.name) {
					newtab.name = name;
					waschanged = true;
					_redrawTabs();
				}
				else if (waschanged) {
					_redrawTabs();
				}
				if (newtab.active) that.SetTitle(newtab.name);
			}.debounce(500));

			// Track hash reset
			app.on('resettabhash.my', function(){
				newtab.hash0 = newtab.hash1 = app.my('manifest').hash();
				newtab.name = app.my('manifest').title();
				_redrawTabs();
			}.debounce(100));

			_redrawTabs();

		})
		.fail(function(a,b){
			// we could not start an app
			cw.lib.note(that.lang.FAIL_TAB_APP, 'error');
			that.my.find('#l-apps>#app-'+tabid).remove();
			cw.log('Photon tab ${1} start fail'.assign(type), path, a);
			newtab.error = true;
			console.log(a,b);
			// insert dummy
			_runApp('error', path, newtab.id, {error:Object.isString(a)&& Object.isString(b)?a+'; '+b:a});
		}.debounce(10));
	}


	// - - - - - - - -

	function _redrawTabsSync(){
		that.my.recalc('#l-apptabs');
	}

	// - - - - - - - -

	function _runApp(type, path, tabid, data) {
		var man = that['$'+type],
				$app = that.my.find('#l-apps>#app-'+tabid),
				$appPromise;

		if (!$app.length || !$app.is('.my-form')) {

			if(!$app.length) {
				$app = $('<div class="l-app" id="app-'+tabid+'"></div>');
				that.my.find('#l-apps').append($app);
			}

			that.my.find('#l-apps>.l-app').addClass('hide');
			$app.removeClass('hide');
			$appPromise = $app.my(man, $.extend({path:path, tabid:tabid}, data || {}));
		}
		else {
			that.my.find('#l-apps>.l-app').each(function(){
				var $t = $(this);
				if ($t.is($app)) $t.removeClass('hide');
				else $t.addClass('hide');
			});
		}

		return $appPromise || $app;
	}

}

cw-Photon.Close:
function _closeTab(opts) {

	// 'closetab' event handler, 
	// bound on app DOM root during app .init()

	var that = this;

	var tabid,
			enforce = false;

	if (Object.isObject(opts)) {
		tabid = opts.tabid || '';
		enforce = opts.enforce || false;
	}
	else tabid = opts+'';

	if (that.Tabs.length<2 || !tabid) return;

	// Search for tab
	var tab = that.Tabs.find(function(t){return t.id == tabid});
	if (!tab) return;

	// Search for app DOM node
	var $app = that.my.find('#l-apps>#app-'+tabid);

	if ($app.length && $app.is('.my-form')) {
		tab.hash1 = $app.my('manifest').hash();
		if (tab.hash1 == tab.hash0) {
			_unmount($app, tab)
		}
		else {
			// here we should check if doc was changed 
			// and show modal popup 'Discard changes?'
			$.my.modal({
				manifest:that.Confirm,
				data:{yes:'Close tab&nbsp;',no:'Cancel close', cancel:'', text:that.lang.DLG_UNSAVED},
				width:300,
				close:true,
				esc:true,
				enter:false,
				css:'lh170 xgray p20 pb25'
			})
			.then(function(res){
				if (res.cmd == 'yes') {
					_unmount($app, tab);
				}
			})
		}
	}
	else _finalize(!tab.active);

	// - - - - - - -

	function _unmount($app, tab) {
		$app.my('remove');
		$app.remove();
		_finalize(!tab.active);
	}

	// - - - - - - -

	function _finalize(skipSwitch) {
		// Clean up history
		that.History.remove(tabid);
		that.Tabs.remove(tab);

		cw.log('Photon tab closed', tab.path);

		if (skipSwitch) {
			that.my.recalc('#l-apptabs');
		}

		else {
			// search for openable tab
			// and switch

			if (!that._compiled || window.history.length == 1) {
				var ptab, tid;
				while (that.History.length || ptab) {
					tid = that.History.pop();
					ptab = that.Tabs.find(function(t){return t.id == tabid});
				}

				if (!ptab) ptab = that.Tabs[0];
				that.Switch(ptab.path, ptab.id);
			}
			else {
				that.my.recalc('#l-apptabs');
				window.history.back();
			}
		}
		that.my.restyle();
	}

}

