	// this.Ls(key) -> return value or null
	// this.Ls(key, null) -> deletes keys
	// this.Ls(key, any)  -> stores value under 'Photon.'+key

	var that = this,
			ls = window.localStorage,
			storage = _photon_LS,
			prefix = prefix0 || that.id || 'X';

