jsontree.MakeList:
function (data,key,state) {

		// Object/array processor,
		// generates typed metaobject

		var that=this,
				dt, a=[], man, bin, 
				hash, b = data.value,
				sdbm = cw.lib.sdbm;
		//for (var i in b) {

		Object.keys(b).forEach(function(i){
			dt = $.type(b[i]);

			// Detect multy
			man = /^(ob|ar)/.test(dt)?"multi":dt;

			// Photon-related stuff
			if (man == 'multi') {
				if (data.key == 'Root' && data.path+''=='' && i=='_attachments') {
					man = 'files';
				}
				else if (data.key == '_attachments' && data.path+'' == 'Root') {
					man = 'file';
				}
			}

			// Detect string-derived types
			if (dt == "string"){
				if (b[i].length > 12 && b[i].to(8) == 'function' && /\}[\r\n\t\s]*$/.test(b[i].substr(-10))) {
					man = "function";
				}
				else if(
					b[i].length>160 && b[i].length < 50e3
					&& /^[a-zA-Z0-9\+\/]+$/.test(b[i].substr(0,158))
					&& /^[a-zA-Z0-9\+\/]+={0,2}$/.test(b[i])
				) {
					try {
						bin = window.atob(b[i]);
						hash = sdbm(b[i]);
						man = "base64";
					}catch(e){}
				}
				else if(
					b[i].length>160 && b[i].length < 50e3
					&& /^data:image\/(jpeg|png|gif);base64,/.test(b[i])
				) {
					try {
						bin = atob(b[i].replace(/^data:image\/(jpeg|png|gif);base64,/,''));
						hash = sdbm(b[i]);
						man = "base64";
					}catch(e){}
				}
			}

			// Do we have viewstate stashed?
			var vs = that.data.viewstate,
					path = data.path.slice(0).add(data.key),
					vkey = path.join('❀')+'❀'+i;

			a.push({
				state:state?state:(vs && vs[vkey]?vs[vkey]:1),
				level:data.level+1,
				manifest:"$"+man,
				path:path,
				type:dt,
				key:i,
				id:i,
				value:b[i],
				bin:bin,
				hash:hash
			});
		});
		return a;
	}

