Compact.doCompact:
function () {
		var that = this,
				res = $.extend(true, {}, that.data),
				compiled = that.Pho('_compiled'),
				es = function(s){return (s+'').escapeHTML()},
				l = that.lang,
				ctr = res.selection.length;

		if (!res.ops.length || !ctr || !Object.keys(res.All).intersect(res.selection).length) return;

		res.selection.forEach(function(db){

			var pis = [];
			// compact docs
			if (res.ops.find('docs')) pis.push(
				that.Req({
					url:[db,'_compact'], 
					method:'POST', 
					headers:{'Content-type':'application/json'}
				}).
				fail(function(code, err, msg){
					console.log('Error starting data compaction of '+db, code, err, msg);
				})
			);
			// purge old views
			if (res.ops.find('views')) pis.push(
				that.Req({
					url:[db,'_view_cleanup'], 
					method:'POST', 
					headers:{'Content-type':'application/json'}
				}).
				fail(function(code, err, msg){
					console.log('Error starting purging old views of '+db, code, err, msg);
				})
			);

			// compact views
			if (res.ops.find('ddocs')) {
				res.dselection.compact(true)
				.forEach(function(ddoc){
					pis.push(
						that.Req({
							url:[db,'_compact', ddoc], 
							method:'POST', 
							headers:{'Content-type':'application/json'}
						}).
						fail(function(code, err, msg){
							console.log('Error starting view compaction of '+db+'/_design/'+ddoc, code, err, msg);
						})
					);
				});
			}

			Q.all(pis)
			.then(function(res){
				cw.lib.note(l.MSG_COMPACT_START.assign(db));
				_end();
			})
			.fail(function(code, err, msg){
				cw.lib.note(l.MSG_COMPACT_FAIL_SOME, 'error');
				_end();
			});

		}.lazy(that.Pho('Cfg').batchCompactDelay));

		function _end(){
			ctr-=1;
			if (ctr>0) return;
			_relist.debounce(500)();
			_relist.debounce(2000)();
			_relist.debounce(6000)();
		}

		function _relist(){ $.my.radio('dblist',res.selection); }
	}

