function () {
	var that = this,
			d = $.extend(true, {}, that.data),
			compiled = that.Pho('_compiled'),
			es = function(s){return (s+'').escapeHTML()},
			l = that.lang,
			req, doc;

	doc = {
		source:d.source,
		target:d.target,
		continuous:(d.mode+'')!=''
	};
	if (d.doc_ids.length) doc.doc_ids = Object.clone(d.doc_ids);
	if (d.filter) doc.filter = d.filter;
	if (Object.size(d.query)) doc.query = Object.clone(d.query, true);


	if (d.mode == 'doc') {
		// construct doc & url
		req = {
			url:['_replicator', d.doc],
			method:'PUT',
			headers:{Accept:'application/json', 'X-Couch-Full-Commit':'true'},
			dataType:'text',
			data:JSON.stringify($.extend({_id:d.doc, owner:cw.me()}, doc))
		};
	}
	else {
		req = {
			url:['_replicate'],
			method:'POST',
			headers:{Accept:'application/json', 'Content-type':'application/json','X-Couch-Full-Commit':'true'},
			dataType:'text',
			data:JSON.stringify(doc)
		}
	}

	return that.Req(req)
	.then(function(res0){
		var res = res0;
		try {
			res = Object.isString(res0)?JSON.parse(res0):res0;
		}catch(e){}
		cw.lib.note(d.mode=='doc'?that.lang.MSG_OK_DOC.assign(es(d.doc)):that.lang.MSG_OK, 'ok');
		$.my.radio('dbupdate', {db:'_replicator', cmd:'write', docs:[d.doc]});
	})
	.fail(function(code, err, msg){
		cw.lib.note(that.lang.MSG_FAIL.assign(code, err), 'error');
	});
}

