$doc.SaveAll:
function _save_$doc(onlySave,silent) {

	// Std fn to be called from tab manager and on save btn click.
	// -- onlySave == true  means we must not load doc after save (when tab is closed ie),
	// -- silent == true    means we do not popup success or fail

	var that = this,
			d = that.data,
			doc = Object.clone(cw.lib.dry(d.doc), true),
			pi = $.Deferred(),
			l = that.lang;

	// try to save
	var method = 'POST',
			url = [d.path[0]],
			headers  = {
				// Ensures immediate commit
				'X-Couch-Full-Commit':'true'
			};
	if (typeof doc._id == 'string') {
		// method should be put
		method = 'PUT';
		url.push(doc._id);
	}
	else delete doc._id;

	if (undefined == doc._id) delete doc._rev;

	// trying to save 1st time

	_saveDoc(doc)
	.fail(function(code, err, msg){
		if (code != 409) {
			// if not a conflict, reject with error
			if (!silent) cw.lib.note(l.ERR_SAVE.assign(code+': '+es(err)), 400); 
			pi.reject(code, err, msg);
		} 
		else {

			//load doc
			that.Req({method:'GET',url:[d.path[0], doc._id]})
			.then(function(xdoc){

				// show conflict modal
				$.my.modal({
					manifest:that.Pho('Confirm'),
					data:{
						text: l.MSG_CONFLICT.assign(_trunc(doc._id, 40), _trunc(doc._rev, 25), _trunc(xdoc._rev, 25)),
						yes:	l.BTN_CONFLICT_YES,
						no: 	l.BTN_CONFLICT_NO,
						cancel:''
					},
					css:'xgray lh170 p20 pb25',
					esc:false,
					enter:false
				})
				.then(function(result){
					if (result.cmd == 'yes') {
						d.doc._rev = xdoc._rev;
						that.SaveAll(onlySave, silent)
						.then(function(res){
							_reloadDoc(true);
							//pi.resolve(res);
						})
						.fail(function(code, err, msg){
							pi.reject(code, err, msg);
						});
					}
					else _saveCancelled();
				})
				.fail(_saveCancelled);

			})
			.fail(function(code, err, msg){
				// have conflict, but failed loading doc
				// reject
				console.log(code,err,msg);
				if (!silent) cw.lib.note(l.MSG_CONFLICT_LOADFAIL);
				pi.reject(999, 'Cancelled by user', l.MSG_CONFLICT_LOADFAIL);
			})

		}
	});

	return pi.promise();

	// - - - - - - - - - - - - 

	function _saveDoc(doc){
		return that.Req({
			url:url, 
			method:method, 
			headers:headers, 
			data:JSON.stringify(doc), 
			dataType:method=='PUT'?'text':'json'
		})
		.then(function(res0){
			var res = res0;
			try {
				res = Object.isString(res0)?JSON.parse(res0):res0;
			}catch(e){}
			// we succeeded
			if (onlySave) {
				_notifyDocSaved();
				return pi.resolve ($.extend(doc,{_id:res.id, _rev:res.rev}));
			}
			else {
				// reload doc if not skipped
				_reloadDoc(true);
			}
		})
	}

	// - - - - - - - - - - - - 

	function _saveCancelled(){
		if (!silent) cw.lib.note(l.MSG_CONFLICT_CANCELLED);
		pi.reject(999, 'Cancelled by user', l.MSG_CONFLICT_CANCELLED);
	}

	// - - - - - - - - - - - - 

	function es(s) {return (s+'').escapeHTML();}
	function _trunc(s, chars) {return es((s+'').truncate(chars || 15,'right','…'));}

	// - - - - - - - - - - - - 

	function _notifyDocSaved(){
		$.my.radio('dbupdate', {db:d.path[0], cmd:'write', docs:[d.doc._id]});
		if (!silent) {
			cw.lib.note(
				l.MSG_SAVE.assign( _trunc(d.doc._id), _trunc(d.doc._rev||'')) ,
				'ok'
			);
		}
	}

	// - - - - - - - - - - - - 

	function _reloadDoc(reset){
		if (reset) {
			// reset to latest rev
			d.path[1] = d.doc._id;
			d.path.length = 2;
			d.rev = '';
			if (d.isNew) {
				d.isNew = false;
				$.my.radio('pho_pathchange', {id:d.tabid, path:d.path, title:that.title()});
			}
		}
		// reload revs list and doc
		that.GetDoc(true)
		.then(function(){
			_notifyDocSaved();
			that.RevsList();
			pi.resolve(d.doc);
		})
		.fail(function(code, err, msg){
			// fail to read doc back
			if (!silent) cw.lib.note(l.ERR_SAVELOAD.assign(code+': '+es(err)), 'error');
			return pi.reject(code, l.ERR_SAVELOAD.assign(err), msg);
		});
	}
}

$doc.GetDoc:
function (redraw) {
	var that = this,
			d = that.data,
			params = {conflicts:true,local_seq:true,revs_info:true},
			url, rev,
			pi;

	// if new, just generate _id

	if (d.isNew){
		var pi = $.Deferred();
		that.Req(['_uuids',{count:5}])
		.then(function(res){
			d.doc._id = (res.uuids||['']).sample();
		})
		.always(function(){
			if (!d.doc._id) d.doc._id = cw.lib.hash8(Date.now()+d.path[0]+Number.random(1,1e15));
			that.Doc = [{dbname:d.path[0], revision:'', baseurl:that.Pho('Base'), doc:that.data.doc}];
			pi.resolve();
		});
		return pi.promise();
	}

	// if not new, start reading real doc

	if (d.path.length > (d.path[1]=='_design'?3:2)) {
		rev = d.path.last().replace(/^\D+/,'');
		url = d.path.to(-1);
	}
	else url = d.path;

	// we have rev, need two requests
	if (rev) {
		// read reqested rev
		return that.Req(url.concat([$.extend(!0,{},params,{rev:rev})]))
		.then(function(res){
			d.doc = _resort(res);
			// read actual doc revto have all sys props in place
			return that.Req(url.concat([params]))
			.then(function(res){
				d.doc = $.extend(d.doc, Object.select(res, ['_conflicts','_revs_info','_local_seq']));
				_cleanRevs(d.doc);
				that.Doc = [{dbname:d.path[0], revision:d.rev, baseurl:that.Pho('Base'), doc:that.data.doc}];
				that.my.trigger('#state-proxy','resettabhash.my');
				if (redraw) that.my.redraw();
			});
		});

	} 

	// no rev, return single request
	else {

		return that.Req(url.concat([params]))
		.then(function(res){
			d.doc = _resort(res);
			_cleanRevs(d.doc);
			that.Doc = [{dbname:d.path[0], revision:d.rev, baseurl:that.Pho('Base'), doc:that.data.doc}];
			that.my.trigger('#state-proxy','resettabhash.my');
			if (redraw) that.my.redraw();
		});
	}

	// - - - - - - - - - - -

	function _resort(res) {
		// moves id, rev and files to top of the tree
		return $.extend(res._attachments?{_id:'',_rev:'',_attachments:{}}:{_id:'',_rev:''},res);
	}

	function _cleanRevs(doc) {
		if (Object.isArray(doc._revs_info)) {
			doc._revs_info = doc._revs_info.filter(function(r){return r.status=='available'});
		}
		d.conflicts = doc._conflicts || [];
		d.revs = (doc._revs_info||[]).map(function(r){return r.rev});
	}

}

$doc.DelDoc:
function _del_doc() {
	var that = this,
			d = that.data,
			doc = Object.clone(cw.lib.dry(d.doc), true),
			islast = d.revs[0] && d.revs[0] == d.doc._rev,
			isconflict = d.conflicts.indexOf(d.doc._rev||'') != -1,
			l = that.lang,
			es = function(s){return (s+'').escapeHTML()},
			_trunc = function (s, chars) {return es((s+'').truncate(chars || 15,'right','…'));};

	var pi = $.Deferred(),
			url = [d.path[0], doc._id, {rev:doc._rev}];

	var trow = '<div class="mb10">{1}</div>';

	$.my.modal({
		width:350,
		manifest:$.extend(
			true, {}, that.Pho('Confirm'),
			{
				ui:{'input[name="retain"]':'retain'},
				style:{' label':'margin:0;line-height:inherit;color:inherit;'}
			}
		),
		data:{
			retain:'no',
			text:[
				!isconflict?'<div class="fs130 red mb5">'+l.TXT_DEL_TITLE+'</div>':'',
				isconflict?'<div class="fs130 orange mb5">'+l.TXT_DEL_TITLE_CONFLICT+'</div>':'',
				trow.assign(l.TXT_DEL_WARN.assign(_trunc(doc._id, 25), _trunc(d.path[0], 25))),
				trow.assign([
					'<label class="xgray"><input type="radio" name="retain" value="no" class="mr6"> '+l.LBL_DEL_ALL+'</label>',
					'<label class="xgray"><input type="radio" name="retain" value="retain" class="mr6"> '+l.LBL_DEL_RETAIN+'</label>'
				].join('')),
				d.conflicts.length && islast?trow.assign(l.TXT_DEL_NODEL):'',
				isconflict?trow.assign(l.TXT_DEL_CONFLICT):''
			].compact(true).join(''),
			yescss:isconflict?'orange':'red',
			yes:l.BTN_DEL_START,
			no:l.BTN_CANCEL,
			cancel:''
		},
		css:'lh160 xgray p20 pb25'
	})
	.then(function(res){
		if (res.cmd!='yes') return pi.reject(999, 'Cancelled', 'Cancelled');
		_delReq(res.retain=='retain');
	})
	.fail(function(){
		pi.reject(999, 'Cancelled', 'Cancelled');
	})


	return pi.promise();

	// - - - - - - - - - - - - 

	function _delReq(retain){

		var req = !retain?{
			url:url,
			method:'DELETE',
			headers:{'X-Couch-Full-Commit':'true'}
		}:{
			url:[d.path[0],'_bulk_docs'],
			method:'POST',
			headers:{'Content-type':'application/json', 'X-Couch-Full-Commit':'true'},
			data: JSON.stringify({docs:[Object.merge({_deleted:true}, doc)]})
		};

		return that.Req(req)
		.then(function(res){

			cw.lib.note(l.MSG_DEL_OK.assign( _trunc(doc._id), _trunc(d.path[0])) , 'ok');

			// notify tabs
			try {
				$.my.radio('dbupdate', {db:d.path[0], cmd:'delete', docs:[doc._id]});
			}catch(e){
				console.log(e);
			}

			// decide should we close tab or reload doc
			if (d.conflicts.length) _reloadDoc(true);
			else {
				(function(){
					that.my.root().trigger('tabclose', {tabid:d.tabid, enforce:true});
				}).debounce(100)();
				pi.resolve(res);
			}
		})
		.fail(function(code, err, msg){
			// fail to read doc back
			cw.lib.note(l.MSG_DEL_FAIL.assign(_trunc(doc._id), code, es(err)), 'error');
			// however, notify tabs
			$.my.radio('dbupdate', d.path[0]);

			return pi.reject(code, err, msg);
		});

	}

	// - - - - - - - - - - - - 

	function _reloadDoc(reset){
		// reset to latest rev
		d.path[1] = doc._id;
		d.path.length = 2;
		var wasrev = d.rev;
		d.rev = '';

		if (wasrev) $.my.radio('pho_pathchange', {id:d.tabid, path:d.path, title:that.title()});

		// reload revs list and doc
		that.GetDoc(true)
		.then(function(){
			cw.lib.note(l.MSG_DEL_RELOAD, '', 4000);
			that.RevsList();
			pi.resolve(d.doc);
		})
		.fail(function(code, err, msg){
			// fail to read doc back
			cw.lib.note(l.MSG_DEL_RELOAD_FAIL.assign(_trunc(d.doc._id), code, es(err)), 'error');
			pi.reject(code, err, msg);
			// enforce tab close
			that.my.trigger('#btn-del-doc', 'tabclose', {tabid:d.tabid, enforce:true});
		});
	}

}

