$config.Cmp:
function _compare() {
	// compares this.Old and data.doc,
	// returns {updated, added, deleted, invalid}

	var res = {
		updated:[],
		added:[],
		deleted:[],
		invalid:{},
		oldcfg:{},
		newcfg:{}
	};

	var that = this,
			l = that.lang,
			le = l.ERR_VAL,
			old = Object.clone(that.Old, true),
			cfg = Object.clone(that.data.doc, true),
			v0 = res.oldcfg = _keys(old, false),
			v1 = res.newcfg = _keys(cfg, true),
			inv = Object.keys(res.invalid),
			k0 = Object.keys(v0).subtract(inv),
			k1 = Object.keys(v1).subtract(inv);

	// deleted
	res.deleted = k0.subtract(k1);
	res.added = k1.subtract(k0);
	res.updated = k1.subtract(res.added).filter(function(k){
		return JSON.stringify(v0[k]) != JSON.stringify(v1[k]);
	});

	return res;

	// - - - - - - - - - - -

	function _keys(obj, check) {
		var a = {},
				re = /^[a-z0-9_\-!\.]+$/i,
				rehkey0 = /^httpd_.+_handlers$/,
				rehkey1 = /^[a-z0-9_\-!\.\/]+$/i;

		Object.keys(obj).forEach(function(lvl0){
			var sobj = obj[lvl0];
			if (!Object.isObject(sobj)) return;

			Object.keys(sobj).forEach(function(lvl1){
				var k = lvl0+'\u2003'+lvl1;
				if (check) {
					if (rehkey0.test(lvl0) && !rehkey1.test(lvl1)) {
						//invalid key
						res.invalid[k] = le.CHARS;
					}
					if (!rehkey0.test(lvl0) && !re.test(lvl1)) {
						//invalid key
						res.invalid[k] = le.CHARS;
					}
					else if (!Object.isString(sobj[lvl1])) {
						//invalid val
						res.invalid[k] = le.VALSTRING;
					}
				}
				a[k] = sobj[lvl1];
			});
		});
		return a;
	}

}

$config.Save:
function _save_config() {
	var that = this,
			cfg = that.Cmp(),
			nc = cfg.newcfg,
			compiled = that.Pho('_compiled'),
			es = function(s){return (s+'').escapeHTML()},
			l = that.lang,
			steps = [],
			errs = {};

	cfg.deleted.forEach(function(k){
		steps.push({key:k, value:null })
	});
	cfg.added.concat(cfg.updated).forEach(function(k){
		steps.push({key:k, value:nc[k] })
	});

	var ctr = steps.length;
	steps.forEach(function(obj, i){

		that.Req({
			url:['_config'].concat(obj.key.split('\u2003')), 
			method:obj.value !== null?'PUT':'DELETE', 
			headers:obj.value !== null?{'Content-type':'application/json'}:{},
			data:obj.value !== null?JSON.stringify(obj.value):undefined
		})
		.then(function(){
			cw.log('Photon updated config key', obj.key.split('\u2003'));
		})
		.fail(function(code, err, msg){
			errs[obj.key] = {code:code, error:err, reason:msg};
		})
		.always(function(){
			ctr -= 1;
			if (!ctr) _end();
		});

	}.lazy(that.Pho('Cfg').batchUpdateCfg || 100));

	function _end(){
		if (Object.size(errs)) {
			cw.lib.note(l.MSG_SAVE_FAIL, 'error');
			console.log ('Errors during config update:');
			console.log(errs);
		}
		else {
			cw.lib.note(l.MSG_SAVE_OK, 'ok');
			that.Get(true);
		}
	}
}

