$view.TMap:
function () {
	var that = this,
			d = that.data,
			j2h = that.Pho('j2h');

	var t = [
		'<div class="view-row" data-key="{_idxsafe}">',
			'<div class="col-ids">',
				'{idsafe}',
				//'<a href="#{href}" class="tdn">{id}</a>',
				'<div class="view-tofilter pseudolink view-hoverbtn ml5" data-filter="{idsafe}"><span class="fi-filter"></span></div>',
				'<div class="view-hoverbtn {nodoc}">',
					'<a href="#{href}" class="tdn"><span class="fi-page-filled"></span></a>',
				'</div>',
			'</div>',
			'<div class="col-vals {css}"><div class="col-trim">{html}</div></div>',
		'</div>'
	].join('');

	// Renderer function

	return function _tmap (row, i) {
		var limit = that.Rows.length,
				mapper = limit<120?_mapFull: limit<250?_mapMedium: _mapSimple,
				chars = limit<40?2000: limit<60?500: limit<120?300: 200,
				lvl = limit<40?5: limit<60?4: limit<120?3: limit<250?3: 2;

		var v = row.value, s;
		var a = j2h(v, chars, ['_id','id','name'], lvl);
		if (a.length==1 && a[0][0]=='short') {
			if (a[0][1][0] == '{') a[0][1] ='Object '+a[0][1];
			else if (a[0][1][0] == '[') a[0][1]='Array '+a[0][1];
		}
		s = a.map(mapper).join('');
		return t.assign({
			_idx:row._idx,
			_idxsafe:row._idxsafe,
			id:row.key,
			idsafe:JSON.stringify(row.key).escapeHTML(),
			href:row.id?(encodeURIComponent(d.path[0]) +'/'+encodeURIComponent(row.id)).escapeHTML():'',
			nodoc:row.id?'':'hide',
			key:row.key,
			//doc:'',
			html:s,
			css:s.length>250?'fs95 lh140 pt3 pb3':'lh140 pt2 pb2'
		});
	}


	// - - - - - - 

	function _mapFull(row){
		if (!row[0]) return row[1];
		return '<span class="jval-'+row[0]+'">'+row[1]+'</span>';
	}

	// - - - - - - 

	function _mapMedium(row){
		if (row[0]!='bracket' && row[0]!='key') return row[1];
		return '<span class="jval-'+row[0]+'">'+row[1]+'</span>';
	}

	// - - - - - - 

	function _mapSimple(row){ return row[1];}
}

