$view.GetView:
function _getView(redraw) {

	// gets viewdata according to current state,

	var that = this,
			d = that.data,
			db = d.path[0],
			params = {limit:100, update_seq:true},
			viewname = that.Vi[d.view]?that.Vi[d.view].path:[db, '_all_docs'],
			pi = $.Deferred(),
			busy = true;

	var recalc = '#state-proxy',
			rmethod = 'check'

	var url = viewname;

	if (d.reverse) params.descending = true;
	params.limit = Math.abs(+d.limit) + 1;

	if (d.start) {
		if (/^_\d+$/.test(d.start)) params.skip = +d.start.substr(1) || 0;
		else {
			var x;
			try {
				x = JSON.parse(d.start);
			}catch(e){}
			params.startkey = undefined!=x?x:d.start;
		}
	}

	if (that.Vi[d.view] && that.Vi[d.view].reduce) {
		var lvl = d.reduce+'';
		if (!lvl) params.reduce=false;
		else if (lvl == 0) params.group = false;
		else if (lvl == 99) params.group = true;
		else {
			params.group = true;
			params.group_level = +lvl;
		}
	}


	var requrl = url.concat([params]);

	if (that.Pending[JSON.stringify(requrl)]) return that.Pending[JSON.stringify(requrl)];

	// mark busy
	(function(){
		if (busy) {
			that.my.root().toggleClass('app-busy', busy);
			$.my.radio('pho_appbusy',{id:d.tabid, busy:busy});
		}
	}).debounce(10)();

	// get data

	return that.Pending[JSON.stringify(requrl)] = that.Req(requrl)
	.then(function(res){

		that.Pending[JSON.stringify(requrl)] = null;

		res.stamp = Date.now()+'';
		res.url = url+'';
		that.Result[0] = res;
		d.total_rows = res.total_rows || -1;
		d.offset = res.offset || -1;
		d.seq = (res.update_seq || Date.now())+'';
		res.rows.forEach(function(row,i){
			row._idx = JSON.stringify([row.key, row.id, i]); 
			row._idxsafe = row._idx.escapeHTML();
		})
		that.Rows = (res.rows || []).slice(0);

		pi.resolve(res);
		if (redraw) that.my[rmethod](recalc);
	}.debounce(10))
	.fail(function(code, err, msg){

		that.Pending[JSON.stringify(requrl)] = null;

		cw.log('Photon failed to read view', db+'/'+viewname, code, err, msg);
		that.Result[0] = {
			url:JSON.stringify(requrl),
			code:code,
			stamp:Date.now()+'',
			ok:false,
			error:err,
			msg:msg
		};
		pi.resolve(that.Result[0]);
		if (redraw) that.my[rmethod](recalc);
	}.debounce(10))
	.always(function(){
		// mark busy
		busy = !1;
		that.my.root().toggleClass('app-busy', busy);
		$.my.radio('pho_appbusy',{id:d.tabid, busy:busy});
	}.debounce(15));
}

$view.GetViews:
function _getViewsList(redraw) {

	// Gets list of all ddocs

	var that = this,
			d = that.data,
			db = d.path[0],
			url = [db,'_all_docs',{startkey:'_design', endkey:'_design0',include_docs:true}],
			viewlist = [{id:'', text:'_all_docs'}],
			vi = {},
			pi = $.Deferred();

	that.Req(url).then(function(res){
		var rows = res.rows||[];
		if (!rows.length) return;
		// else viewlist.push({id:'_', text:'_design/*'}); 

		var reerl0 = /^\[\r\n\s\t]*fun[\r\n\s\t]*\([\r\n\s\t]*\{/,
				reerl1 = /\.[\r\n\s\t]*$/;

		rows.forEach(function(row){
			var ddoc = row.doc,
					views = ddoc.views || {},
					v = Object.keys(views),
					g = {text:row.id, children:[]};
			if (!v.length) return;
			v.forEach(function(key){
				var r = views[key];

				// Detect map
				if (!Object.isObject(r) || !Object.isString(r.map)) return;

				var vid = row.id+'\ufffd'+key,
						s0 = {id:vid, text:'\u00a0\u00a0'+key},
						v0 = {path:[db,'_design',row.id.split('/')[1],'_view',key], reduce:false, type:''};


				if (Object.isFunction(cw.lib.unjson([r.map])[0])) v0.type = 'js';
				else if(reerl0.test(r.map) && reerl1.test(r.map)) {
					s0.text+= '(e)';
					v0.type = 'erlang';
				}
				else return;


				// Detect reduce
				var red = r.reduce,
						fold = '';
				if (Object.isString(red)) {
					if (red[0] == '_') red = red.from(1);
					if (red == 'sum') fold = 'Σ';
					else if (red = 'count') fold = '#';
					else if (red = 'min') fold = '⊻';
					else if (red = 'max') fold = '⊼';
					else if (red = 'stats') fold = '=';
					else if (red = 'sumsqr') fold = 'Σ²';
					else if (Object.isFunction(cw.lib.unjson([red])[0])) fold = 'f';
					else if (reerl0.test(red) && reerl1.test(red)) fold = 'e';

					if (fold) {
						s0.text+='\u2009•\u2009'+fold;
						v0.reduce = true;
					}
				}
				g.children.push(s0);
				vi[vid] = v0;
			});

			// put in list if any
			if (g.children.length) {
				g.children = g.children.sortBy('text');
				viewlist.push(g);
			}
		});
		viewlist = viewlist.sortBy('text');
	})
	.fail(function(code, err, msg){
		cw.log('Photon failed to read ddocs for the bucket', db, code, err, msg);
		cw.lib.note(that.lang.ERR_GETVIEWS.assign(db), 'error');
	})
	.always(function(){
		that.Views = viewlist;
		that.Vi = vi;
		if (redraw) $('#view-name').select2({data:viewlist,minimumResultsForSearch:12});
		pi.resolve(viewlist);
	});


	return pi.promise();

}

$view.DelDocs:
function _del_doc() {
	var that = this,
			d = that.data,
			sel = d.selection.slice(0),
			sl = sel.length,
			l = that.lang,
			es = function(s){return (s+'').escapeHTML()},
			_trunc = function (s, chars) {return es((s+'').truncate(chars || 15,'right','…'));};

	var pi = $.Deferred(),
			trow = '<div class="mb10">{1}</div>';

	$.my.modal({
		width:300,
		manifest:that.Pho('Confirm'),
		data:{
			text:[
				'<div class="fs130 red mb5">'+l.TXT_DEL_TITLE+'</div>',
				trow.assign(l.TXT_DEL_WARN(sl, _trunc(d.path[0], 25)))
			].join(''),
			yescss:'red',
			yes:l.BTN_DEL_START,
			no:l.BTN_CANCEL,
			cancel:''
		},
		css:'lh160 xgray p20 pb25',
		esc:true,
		enter:false
	})
	.then(function(res){
		if (res.cmd!='yes') return pi.reject(999, 'Cancelled', 'Cancelled');
		_delDocs();
	})
	.fail(function(){
		pi.reject(999, 'Cancelled', 'Cancelled');
	})


	return pi.promise();


	// - - - - - - - - - - - - 

	function _delDocs(){

		var osel = cw.lib.a2o(sel),
				keys = [],
				docs = that.Rows.to(+d.limit).filter(function(d){
					return osel[d.key]
				}).map(function(row){
					keys.push(row.key);
					return {_id:row.key, _rev:row.value.rev, _deleted:true};
				});

		var req = {
			url:[d.path[0],'_bulk_docs'],
			method:'POST',
			headers:{'Content-type':'application/json', 'X-Couch-Full-Commit':'true'},
			data: JSON.stringify({docs:docs})
		};

		return that.Req(req)
		.then(function(res){

			// parse response
			var num = res.length,
					delnum = res.count(function(row){ return !row.error });

			cw.lib.note(l.MSG_DEL_OK( num, delnum, _trunc(d.path[0])), num == delnum?'ok':'error', 5000);
			if (num>delnum) console.log(res);

			// notify tabs
			$.my.radio('dbupdate', {db:d.path[0], cmd:'delete', docs:keys});

			// reload view
			//that.GetView(true);
			pi.resolve(res);
		})
		.fail(function(code, err, msg){
			// fail to read doc back
			cw.lib.note(l.MSG_DEL_FAIL.assign(code, es(err)), 'error');
			return pi.reject(code, err, msg);
		});

	}
}

$view.s2p:
function _state2path() {
	// converts curr state to path array

	var that = this,
			d = that.data,
			db = d.path[0],
			p = [db];

	if (!d.start && !d.view) return [d.path[0]];

	var view = that.Vi[d.view];
	if (view) {
		p.push('_view', view.path[2], view.path[4]);
	}
	else {
		p.push('_all_docs');
	}

	if (!d.start) return p;
	p.push(d.start, (d.reverse?'-':'')+(+d.limit));
	return p;

}

