function _batch_info(list,delay) {
		var that = this,
				result = [];
		list./*randomize().*/forEach(function(s, i){
			var dbname = s;
			if (that.Batch[dbname]) return result[i] = that.Batch[dbname];

			result[i] = Q.delay(1+delay*i)
			.then(function(){
				var req = that.Req({url:[dbname]})
				.then(function(res){
					if (!that.All[dbname]) return;
					$.extend(that.All[dbname], res, {stamp:Date.now()});
					that.Relist();
				})
				.always(function(){
					delete that.Batch[dbname];
				});
				if (i==list.length-1) req.always(function(){that.Relist();}.debounce(200));
				return req;
			});
		});
		return result;
	}

