$dbs.GetTasks:
function (redraw) {
	var that = this,
			d = that.data,
			all = that.All,
			l = that.lang,
			es = function(s){return (s+'').escapeHTML()},
			_trunc = function (s, chars) {return es((s+'').truncate(chars || 20,'middle','…'));},
			spt = '<span title="{2}">{1}</span>',
			nw = '<nobr>{1}</nobr>',
			pi = $.Deferred();

	if (!that.my.indom() || that.my.root().hasClass('hide')) return pi.resolve().promise();

	that.Req({url:['_active_tasks']})
	.then(function(res0){
		that.Tasks.length = 0;

		var res = res0.concat(that.TaskMock||[]);

		// preprocess tasks 
		res.forEach(_processTask);

		// sort, make old appear at bottom,
		// and push to this.Tasks
		res.sortBy('started_on', true).forEach(function(row){that.Tasks.push(row)});

	})
	.then(function(){
		if (!that.Pho('Cfg').tasksReadReplicator || d.task.filter.indexOf('compaction')>-1) return _endUp();

		// read _replicator DB
		that.Req({
			url:['_replicator','_all_docs',{include_docs:true}],
			dataType:'json'
		})
		.then(function(res){
			//console.log(res.rows);
			res.rows.forEach(function(row){
				if (row.doc._replication_state == 'error') that.Tasks.push(_mimicTaskErr(row.doc));
			});
			_endUp();
		})
		.always(function(){
			_endUp();
		})
	})
	.fail(function(code, err, msg){
		// Swallow fail
		pi.resolve(that.Tasks);
	});

	return pi.promise();

	// - - - - - - -

	function _mimicTaskErr(x) {

		var dt = Date.create(x._replication_state_time).valueOf()/1000|0;

		var t = {
			pid: 'Error',
			continuous: x.continuous,
			doc_id: x._id,
			progress: 0,
			source: x.source,
			target: x.target,
			started_on: dt,
			updated_on:dt,
			type: "replication"
		}

		return _processTask(t);

	}

	// - - - - - - - 

	function _processTask(row){

		// clean task type
		var ts = row.type.replace(/_/g,' ')
		.replace(/database/gi,'DB')
		.replace(/compaction/gi,'compact')
		.replace(/replication/gi,'');
		ts = ts.compact();
		ts = ts?ts+':':'';
		row._type = es(ts.to(1).toUpperCase()+(ts||'').from(1));

		var arrow = ' ➝\u00a0',
				terr = '<span class="red1 fs95">{1}</span>';

		// full text index
		row._index = JSON.stringify(row).toLowerCase().replace(/[",\{\}\[\]]/g,' ').compact();

		// clean pid
		if (row.pid != 'Error') {
			row._pid = '‹<span class="fs95">'+row.pid.replace(/[<>]/g,'')+'</span>›';
			row._pidsafe = es(row.pid);
		}
		else {
			row._pid = terr.assign('<span class="fi-alert fs95"></span> Error');
			row._pidsafe = 'Error';
			arrow = terr.assign(arrow);
		}

		// task start time
		var stamp = row.started_on;
		if (stamp) {
			var dt = Date.create(+stamp*1000);
			if (!dt.isThisYear()) row._start = dt.format('{d} {Mon} {yyyy}');
			else if (!dt.isToday()) row._start = dt.format('{d} {Mon}, {H}:{mm}');
			else row._start = dt.format('{H}:{mm}:{ss}');
		}
		else row._start = '???';

		// progress %
		if (row.pid != 'Error') row._progress = Object.isNumber(row.progress)?(row.progress.clamp(0,100)|0)+'%':'???';
		else row._progress = '';

		// description
		if (row.source && row.target) {
			row._desc = nw.assign(_trim(row.source, 30)) + arrow + nw.assign(_trim(row.target, 30));
			if (row.doc_id) row._desc = '<a class="tdn" href="#_replicator/'+es(row.doc_id)+'">'+row._desc+'</a>';
		}
		else if (/compaction/.test(row.type)) {
			row._desc = nw.assign(_trim(row.database));
		}
		else row._desc = row._pid;

		return row;
	}

	// - - - - - - - 

	function _endUp() {
		// sort, make old appear at bottom,
		// and push to this.Tasks
		var a = that.Tasks.slice(0);
		that.Tasks.length = 0;
		a.sortBy('started_on', true)
		.forEach(function(row){that.Tasks.push(row)});
		if (redraw) that.my.recalc('#task-list');
		pi.resolve(that.Tasks);
	}


	// - - - - - - - 

	function _trim(path, chars){

		if (!Object.isString(path) || !/^http[s]?:\//.test(path)) return spt.assign(_trunc(path+'', chars), es(path+''));

		var u = new URL(path),
				p = [],
				tico = '<span class="ml3 fs95 o40 dib vat mt1 mb-1 fi-{1}"></span>',
				local = u.hostname =='127.0.0.1' || u.hostname == 'localhost';

		var tpath = !local?u.hostname+u.pathname:u.pathname.replace(/^\/|\/$/g,'');
		p.push(spt.assign(_trunc(tpath, chars), es(path)));

		if (!local) {
			p.push(tico.assign(u.protocol=='https:'?'lock':'unlock red1'));
		}
		if (u.username || u.password) p.push(tico.assign('torso'));


		return p.join('');

	}
}

