function ($o,that,oncommit) {
		var d = that.data;
		$o.on("click.my", function(evt){

			var $t = $(evt.target);
			if ($t.is('a') || $t.is('img')) return;

			var $n = that.my.find('.inav');
			if (!$n.hasClass("iseditor")) {

				if (that.RT('Lib').isSystem.call(that, d)) {
					cw.lib.note("Can’t change system properties.","error");
				}
				else {
					d.state = 2;
					$n.addClass("iseditor");
					$o.addClass('hide');

					// Run editor
					that.my.find('.ieditor').my(
						that.RT('MEdit'), 
						{text:d.value+'', mode:that.CM || 'auto'}
					);
				}
			}
		});

		that.my.root()
		.on("editorcommit.my", function(evt){
			evt.stopPropagation();
			var $n = that.my.find('.inav');
			if ($n.hasClass("iseditor")) {
				var prev = d.value;
				d.value = that.my.find('.ieditor').my('data').text;
				_closeEd();
				if (typeof oncommit == 'function') oncommit(d.value, prev);
				else {
					//$o.text('"'+d.value.to(140)).escapeHTML().trigger("check");
					$o.trigger("check");
				}
			}
		})
		.on("editorcancel.my", function(evt){ 	
			evt.stopPropagation();
			_closeEd(); 
		});

		// - - - - - -

		function _closeEd(){
			d.state = 1;
			d.hash = cw.lib.sdbm(d.value);
			that.my.find('.ieditor').my('remove');
			that.my.find('.inav').removeClass('iseditor');
			$o.removeClass('hide');
			//that.my.root().off('editorcommit.my').off('editorcancel.my')
		}

	}

