	var $p = $b,
			p = $f.data("my").data,
			mn = $f.data("my").manifest,
			t = $.type(p.value),
			isa = t=="array",
			key = $f.my("data").key,
			clip = that.Ls("Clip")||{type:""},
			sample = {
				object:{},
				array:[],
				string:"",
				boolean:true,
				number:0
			};
	$b.parent().addClass("hover");
	$f.addClass("hover");
	$(this).modal({
		manifest:that.MAdd,
		data:{
			cmd:'prepend',
			text:'New '+(isa?'member':'property')+' in <b>'+p.key+':'+(isa?'[]':'{}')+'</b>',
			prepend:(isa?'Insert':'Prepend'),
			append:(isa?'':'Append'),
			isarray:isa,
			key:isa?"0":'',
